import { Link } from 'react-router-dom';

export default function SignForm(props) {
  return (
    <form className='sing-form'>
      <h2 className='sign-from__title'>{props.title}</h2>
      <fieldset className='sign-from__fieldset'>
        <input className='sing-form__input' name='email' type='email' />
        <input className='sing-form__input' name='password' type='password' />
        <button className='sign-form__button' type='submit'>
          {props.buttonText}
        </button>
        {children}
      </fieldset>
    </form>
  );
}
